const INITIAL_STATE = {
    subtemas: [],    
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_subtemas':
            return { ...state, subtemas: action.payload }
        case 'crear_subtema':
            return {
                ...state,
                subtemas: action.payload
            }
        case 'editar_subtema':
            return {
                ...state,
                subtemas: action.payload
            }
        case 'eliminar_subtema':
            return {
                ...state,
                subtemas: action.payload
            }
        default:
            return state;
    }
}
